(59, 'storefront-customize', 'info', 'en_US', 'Design your store with Storefront 🎨', 'Visit the Storefront settings page to start setup and customization of your shop.', '{}', 'unactioned', 'storefront', '2023-05-05 04:19:50', NULL, 0, 'plain', '', 0, 0, 'info'),
